import React from 'react';

const Menu = () => {
    return (
        <div>
            <h1>Menu</h1>
            <ul>
                <li>Pizza - $10</li>
                <li>Burger - $8</li>
                <li>Pasta - $12</li>
            </ul>
        </div>
    );
};

export default Menu;
